// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Monetization {
    address public owner;
    uint public subscriptionFee = 0.1 ether;
    mapping(address => bool) public premiumUsers;
    mapping(address => uint) public donations;

    event Subscribed(address indexed user);
    event Donated(address indexed user, uint amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function subscribe() public payable {
        require(msg.value == subscriptionFee, "Incorrect subscription amount");
        premiumUsers[msg.sender] = true;
        emit Subscribed(msg.sender);
    }

    function donate() public payable {
        require(msg.value > 0, "Donation amount must be greater than zero");
        donations[msg.sender] += msg.value;
        emit Donated(msg.sender, msg.value);
    }

    function withdraw() public onlyOwner {
        payable(owner).transfer(address(this).balance);
    }

    function setSubscriptionFee(uint _fee) public onlyOwner {
        subscriptionFee = _fee;
    }
}
